Side node: if you’re using a lot of static variables, it’s quite likely you may run into what’s called a static initialization race in C++.  Unlike Java, C++ makes no guarantees about what order static initializers run in across object files (they’re guaranteed to run top-to-bottom within a single source file, but not across source files).  So it’s very dangerous to use them (it’s very easy to have a subtle dependency and your code will fail at runtime with absolutely no warning from the compiler).  In WPILib, we completely avoid them, instead using singletons (e.g. GetInstance()) or explicit initialize function calls, but some vendor libraries may use them.

